import React from "react";
import "./style.css"
import Opcion from "../Opcion/Opcion"

function Navbar() {

    const opciones = ["ADMIN", "Pages", "Charts", "Tables"]; 
    return (


        <nav>
            <ul className="main-nav">
                  <Opcion name={"ADMIN"}/>
                  <Opcion name={"Pages"}/>
                  <Opcion name={"Charts"}/>
                  <Opcion name={"Tables"}/>

            </ul>
            <ul className="user">

            <li>Nombre usuario <img src="./imgs/user.jpg" alt=""/></li>
            </ul>

        </nav>



    )
}

export default Navbar
